import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import startComponent from './components/StartTestComponent.jsx';
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<startComponent />} />
        <Route path="/test" element={<h1>Test Page</h1>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
